BEGIN

CREATE TABLE naughty_list (address STRING);

CREATE TABLE snapshot_participants_1 (address STRING);

CREATE TABLE snapshot_participants_2 (address STRING);


CREATE TABLE all_versions_final_deltas AS(
    SELECT * FROM(
    SELECT *,
    "V1" as source
     FROM `v1`
    UNION ALL
    SELECT *,
    "V2_DAI" as source
    FROM `v2_dai`
    UNION ALL
    SELECT *,
    "V2_SAI" as source
    FROM `v2_sai`
    UNION ALL
    SELECT *,
    "V2_USDC" as source
    FROM `v2_usdc`
    UNION ALL
    SELECT *,
    "V2_USDC_POD" as source
    FROM `v2_usdc_pods`
    UNION ALL
    SELECT *,
    "V2_DAI_POD" as source
    FROM `v2_dai_pods`
    UNION ALL    
    SELECT *,
    "V3_UNI" as source
    FROM `v3_uni`
    UNION ALL 
    SELECT *,
    "V3_DAI" as source
    FROM `v3_dai`
    UNION ALL 
    SELECT *,
    "V3_USDC" as source
    FROM `v3_usdc`
    )
    WHERE address NOT IN  (
        SELECT address FROM `naughty_list` -- filter out naughty list
    )
);

CREATE TABLE voted_at_least_once AS(
    SELECT * FROM(
    SELECT * FROM `snapshot_participants_1`
    UNION DISTINCT
    SELECT * FROM `snapshot_participants_2`)
    WHERE address IN (SELECT address FROM `all_versions_final_deltas`) -- make sure snapshot address has participated in protocol
);

END;